#[no_mangle] pub extern fn rust_eh_register_frames () {}
#[no_mangle] pub extern fn rust_eh_unregister_frames () {} Note the use of abort: the exchange_malloc lang item is assumed to return a valid pointer, and so needs to do the check internally. Other features provided by lang items include: overloadable operators via traits: the traits corresponding to the ==, <, dereferencing (*) and + (etc.) operators are all marked with lang items; those specific four are eq, ord, deref, and add respectively. stack unwinding and general failure; the eh_personality, eh_unwind_resume, fail and fail_bounds_checks lang items. the traits in std::marker used to indicate types of various kinds; lang items send, sync and copy. the marker types and variance indicators found in std::marker; lang items covariant_type, contravariant_lifetime, etc. Lang items are loaded lazily by the compiler; e.g. if one never uses Box then there is no need to define functions for exchange_malloc and box_free. rustc will emit an error when an item is needed but not found in the current crate or any that it depends on. Most lang items are defined by libcore, but if you're trying to build an executable without the standard library, you'll run into the need for lang items. The rest of this page focuses on this use-case, even though lang items are a bit broader than that.

